[{"location":"idealni_pripad/#Zakladni-pokus","page":"Idealni pripad","title":"Zakladni pokus","text":"","category":"section"},{"location":"idealni_pripad/","page":"Idealni pripad","title":"Idealni pripad","text":"using Plots","category":"page"},{"location":"idealni_pripad/","page":"Idealni pripad","title":"Idealni pripad","text":"The Plots package is not a standard plotting package known from other languages. The Plots package provides a unified interface and toolset for creating plots. The plots themselves are drawn by different backends, like GR, PyPlot, PGFPlotsX, or Plotly. If one backend does not support desired features, it is possible to switch to another backend with one command without any further changes to the code.","category":"page"},{"location":"idealni_pripad/","page":"Idealni pripad","title":"Idealni pripad","text":"warning: Time for the first plot\n","category":"page"},{"location":"idealni_pripad/","page":"Idealni pripad","title":"Idealni pripad","text":"Compared to Python or Matlab, it takes some time to create the first plot in a new Julia session. In Julia, all functions are compiled during their first run, which slows the first run down.","category":"page"},{"location":"idealni_pripad/","page":"Idealni pripad","title":"Idealni pripad","text":"The core of the Plots package is the plot function that provides an interface for creating all types of plots. The default plot style is the line style. The line plot can be created by calling the plot function on two vectors.","category":"page"},{"location":"idealni_pripad/","page":"Idealni pripad","title":"Idealni pripad","text":"using Plots\nx = range(0, 2Ï€; length = 100)\ny = sin.(x)\nplot(x, y)","category":"page"},{"location":"","page":"Home","title":"Home","text":"using Plots\nENV[\"GKSwstype\"] = \"100\"\ngr()","category":"page"},{"location":"#Landing-page","page":"Home","title":"Landing page","text":"","category":"section"}]
